We need S to expand to two nonterminals A B which each yield exactly one terminal (so the string has length 2). The only two choices are

1) S → NT27 NT7  
   NT27’s terminal productions are {'t21','t24','t4'}  
   NT7’s terminal productions are {'t23','t16','t2'}  

2) S → NT14 NT20  
   NT14’s terminal productions are {'t22','t6'}  
   NT20’s terminal productions are {'t0','t28','t13'}  

None of these nonterminals can directly produce ‘t18’ or ‘t26’ in the needed positions, and any further binary expansions only produce two or more terminals. Hence no derivation of exactly “t18 t26” exists.  

No

After filling in the length‑1 “cells” of the CYK table, you get:

 1: {NT19}  
 2: {NT28, NT29}  
 3: {NT9, NT12, NT13, NT16}  
 4: {NT0, NT19}  
 5: {NT0, NT19, NT27, NT28}  
 6: {NT3, NT6, NT8, NT13}  

Using the numerous binary productions (and in particular the fact that NT26→NT0 NT26 plus multiple terminals gives you unbounded “fill”), one finds that there is a split of the 6‐token string so that 

  S→NT27 NT7  

and the left half is derived by NT27 while the right half is derived by NT7. A full CYK build (or a sketch of mutually recursive uses of NT26, NT27, NT7, etc.) shows that the entire length‑6 string is indeed in the language.  

Yes

After filling in the “unit” table for length‐1 substrings, one finds that

position 1,2 ⟹ {NT5,NT10,NT19,NT24,NT25}  
position 3 ⟹ {NT9,NT13,NT24}  
position 4 ⟹ {NT17,NT22}  
position 5 ⟹ {NT5,NT9,NT12,NT23,NT29}  
position 6 ⟹ {NT0,NT19}  
position 7 ⟹ {NT0,NT2,NT9,NT17,NT23}  
position 8 ⟹ {NT2,NT5,NT8,NT24,NT29}  
position 9 ⟹ {NT5,NT19}  

Attempting all binary splits for S→NT27 NT7 or S→NT14 NT20 (lengths 1∣8,2∣7,…,8∣1) fails because neither NT27 nor NT14 can cover the left piece and neither NT7 nor NT20 can cover the right piece.  

Hence the string is not in L(G).  
